window.bookSummaryJSON = "<p>I've always known pain. Existence. Night.</p> <p>Made a sinner. Without a soul to keep me tethered to the world I so desperately want to be a part of but am damned to rule...</p> <p>Life isn't living. Not when everyone sees you as enemy number one, King of the demon race and yet something much more...powerful and sinister pulses beneath the surface of my skin.</p> <p>It started when I met her, the power surging under my fingertips like the cruel universe was finally answering my screams at night for something more. And just like that, the memories come, only I don't know if they're mine or someone else's entirely.</p> <p>Long ago, I made a bargain with a god. A soul for a soul. I spent thousands of years without this awareness and now?</p> <p>Everything I touch turns to ash. Even my own immortal friends fear what I am. Everyone but her. The day to my night.</p> <p>Part of me doesn't want to know what I am. But it's too late, too all-consuming. Darkness is coming. That darkness, I'm afraid. Is me.</p> <p><b>Contains mature themes.</b></p>"; 
